? Les deux fichiers YAMLs complets, avec l'entièreté des régions et des départements,
  sont fournis avec l'application. En cas d'utilisation, ne pas directement modifier
  les originaux mais plutôt des copies (afin de ne pas perdre la liste des lieux non
  visités)
: afrikaans: Die twee volledige YAML-lêers, met al die streke en departemente, word
    saam met die toepassing verskaf. Indien dit gebruik word, moenie die oorspronklike
    lêers direk wysig nie, maar eerder kopieë (sodat die lys van plekke wat nie besoek
    is nie, nie verlore gaan nie)
  albanais: Të dy skedarët e plotë YAML, me të gjitha rajonet dhe departamentet, janë
    dhënë me aplikacionin. Në rast përdorimi, mos i modifikoni direkt origjinalet,
    por më tepër kopjet (për të mos humbur listën e vendeve të pavizituara)
  allemand: Die beiden vollständigen YAML-Dateien, mit allen Regionen und Departements,
    werden mit der Anwendung geliefert. Im Falle der Verwendung sollten nicht direkt
    die Originale, sondern Kopien modifiziert werden (um die Liste der unbesuchten
    Orte nicht zu verlieren)
  anglais: The two complete YAML files, with all regions and departments, are provided
    with the application. When using them, do not directly modify the originals but
    rather copies (so as not to lose the list of unvisited places)
  arabe: يتم توفير ملفي YAML الكاملين، مع جميع المناطق والإدارات، مع التطبيق. في حالة
    الاستخدام، لا تقم بتعديل الملفات الأصلية مباشرةً، بل قم بتعديل النسخ (لتجنب فقدان
    قائمة الأماكن غير المزارة)
  arménien: Երկու լրիվ YAML ֆայլերը, բոլոր մարզերով և դեպարտամենտներով, տրամադրվում
    են հավելվածի հետ։ Օգտագործելու դեպքում, ուղղակիորեն չփոփոխել բնօրինակները, այլ
    կրկնօրինակները (չայցելված վայրերի ցանկը չկորցնելու համար)։
