    kopiak (bisitatu gabeko lekuen zerrenda ez galtzeko)
  bengali: সম্পূর্ণ অঞ্চল ও বিভাগ সহ দুটি সম্পূর্ণ YAML ফাইল অ্যাপ্লিকেশনটির সাথে
    সরবরাহ করা হয়েছে। ব্যবহারের ক্ষেত্রে, মূল ফাইলগুলি সরাসরি পরিবর্তন করবেন না,
    বরং সেগুলির অনুলিপি ব্যবহার করুন (অদেখা স্থানগুলির তালিকা হারানোর ঝুঁকি এড়াতে)।
  birman: အပလီကေးရှင်းနဲ့အတူ ဒေသနဲ့ ခရိုင်အားလုံးပါဝင်တဲ့ YAML ဖိုင်နှစ်ခုလုံးကို
    ပေးထားပါတယ်။ အသုံးပြုတဲ့အခါ မူရင်းဖိုင်တွေကို တိုက်ရိုက်မပြင်ဆင်ဘဲ မိတ္တူတွေကို
    အသုံးပြုပါ။ (မရောက်ဖူးတဲ့ နေရာတွေစာရင်း မပျောက်အောင်)
  breton: An daou restr YAML leun, gant an holl rannvroioù hag departamantoù, a zo
    pourchaset gant ar reizhiad. Pa vezont implijet, na cheñchit ket diouzhtu ar re
    orin met kentoc'h eillekadennoù (evit chom hep koll roll al lec'hioù n'int ket
    bet gwelet)
  bulgare: Двата завършени YAML файла, с всички региони и области, са предоставени
    с приложението. При използване, не променяйте директно оригиналите, а копия (за
    да не загубите списъка с ненаселени места)
  catalan: Els dos fitxers YAML complets, amb la totalitat de les regions i dels departaments,
    es proporcionen amb l'aplicació. En cas d'ús, no modifiqueu directament els originals,
    sinó més aviat còpies (per no perdre la llista de llocs no visitats)
  coréen: 전체 지역과 부서가 포함된 두 개의 완전한 YAML 파일이 앱과 함께 제공됩니다. 사용 시에는 원본을 직접 수정하지 말고 복사본을
    사용하세요(방문하지 않은 장소 목록을 잃지 않도록)
  danois: De to komplette YAML-filer, med alle regioner og departementer, leveres
    med applikationen. Ved brug må originalerne ikke ændres direkte, men derimod kopier
    (for ikke at miste listen over ikke-besøgte steder)
  espagnol: Los dos archivos YAML completos, con la totalidad de las regiones y departamentos,
    se proporcionan con la aplicación. En caso de uso, no modificar directamente los
    originales sino copias (para no perder la lista de lugares no visitados)
  esperanto: La du plenaj YAML-dosieroj, kun ĉiuj regionoj kaj departementoj, estas
    provizitaj kun la aplikaĵo. Okaze de uzado, ne rekte modifi la originalojn sed
    prefere kopiojn (por ne perdi la liston de la neloĝitaj lokoj)
  estonien: Kaks täielikku YAML-faili, koos kõigi piirkondade ja departemangudega,
    on rakendusega kaasas. Kasutamisel ärge algdokumente otse muutke, vaid koopiaid
    (et mitte kaotada külastamata kohtade nimekirja)
  finnois: Kaksi täydellistä YAML-tiedostoa, joissa on kaikki alueet ja departementit,
    toimitetaan sovelluksen mukana. Käytettäessä älä muokkaa suoraan alkuperäisiä,
    vaan kopioita (jotta et menetä vierailtujen paikkojen luetteloa)
  français: Les deux fichiers YAMLs complets, avec l'entièreté des régions et des
    départements, sont fournis avec l'application. En cas d'utilisation, ne pas directement
    modifier les originaux mais plutôt des copies (afin de ne pas perdre la liste
    des lieux non visités)
  gallois: Darperir y ddwy ffeil YAML gyflawn, gyda'r holl ranbarthau a'r adrannau,
    gyda'r cais. Mewn achos o ddefnydd, peidiwch â diwygio'r gwreiddiol yn uniongyrchol
    ond yn hytrach gopïau (er mwyn peidio â cholli'r rhestr o leoedd nad ydynt wedi'u
    harchwilio)
  grec: Τα δύο πλήρη αρχεία YAML, με όλες τις περιφέρειες και τους νομούς, παρέχονται
    με την εφαρμογή. Σε περίπτωση χρήσης, μην τροποποιήσετε απευθείας τα πρωτότυπα,
    αλλά αντίγραφα (ώστε να μην χαθεί η λίστα των μη επισκέψιμων τοποθεσιών)
  géorgien: აპლიკაციასთან ერთად მოწოდებულია ორი სრული YAML ფაილი, ყველა რეგიონითა
    და დეპარტამენტით. გამოყენების შემთხვევაში, არ შეცვალოთ პირდაპირ ორიგინალები, არამედ
    ასლები (გამოუყენებელი ადგილების სიის დაკარგვის თავიდან ასაცილებლად)
  hindi: एप्लिकेशन के साथ दोनों पूर्ण YAML फाइलें, जिनमें सभी क्षेत्र और विभाग शामिल
    हैं, प्रदान की जाती हैं। उपयोग के मामले में, मूल फाइलों को सीधे संशोधित न करें,
    बल्कि उनकी प्रतियां बनाएं (ताकि गैर-यात्रा स्थानों की सूची खो न जाए)।
  hongrois: A két teljes YAML fájl, a régiók és megyék egészével, a alkalmazáshoz
    mellékelve van. Használat esetén ne közvetlenül módosítsa az eredetit, hanem a
    másolatait (hogy ne veszítse el a meg nem látogatott helyek listáját)
  indonésien: Dua file YAML lengkap, dengan semua wilayah dan departemen, disediakan
    bersama aplikasi. Jika digunakan, jangan langsung mengubah yang asli tetapi salinannya
    (agar tidak kehilangan daftar tempat yang belum dikunjungi)
  irlandais: Soláthraítear an dá chomhad YAML iomlána, leis na réigiúin agus na ranna
    ar fad, leis an iarratas. Má úsáidtear iad, ná athraigh na bunleaganacha go díreach
    ach cóipeanna (ionas nach gcaillfear an liosta de na háiteanna nár tugadh cuairt
    orthu)
  islandais: Tvær fullkomnar YAML-skrárnar, með öllum svæðum og sýslum, fylgja forritinu.
    Við notkun, ekki breyta frumritunum beint heldur afritum (til að missa ekki listann
    yfir ósótta staði)
  italien: I due file YAML completi, con l'intera lista di regioni e dipartimenti,
    sono forniti con l'applicazione. In caso di utilizzo, non modificare direttamente
    gli originali ma piuttosto delle copie (in modo da non perdere la lista dei luoghi
    non visitati)
  japonais: 完全な地域と県を含む二つのYAMLファイルは、アプリケーションに付属しています。使用する際は、オリジナルのファイルを直接変更せず、代わりにコピーを使用してください（未訪問の場所のリストを失わないために）。
  kazakh: Екі толық YAML файлы, барлық облыстар мен аудандармен бірге, қосымшамен
    бірге ұсынылады. Пайдаланған жағдайда, түпнұсқаларды тікелей өзгертпеңіз, көшірмелерін
    қолданыңыз (бармаған жерлердің тізімін жоғалтпау үшін)
  kurde: Du dosya YAML'ê yên temam, bi tevahiya herêm û departmanan re, bi serîlêdanê
    re têne peyda kirin. Di rewşa bikaranînê de, rasterast orîjînalan neguherînin
    lê kopiyan (ji bo ku navnîşa cîhên nehatine ziyaret kirin winda nekin)
  latin: Duo fasciculi YAML integri, cum omnibus regionibus et departimentis, cum
    applicatione traduntur. In usu, non statim originalia mutare sed potius exemplaria
    (ne amittatis indicem locorum non visoritorum)
  letton: Pilnīgi divi YAML faili ar visiem reģioniem un departamentiem ir pievienoti
    lietotnei. Ja vēlaties tos izmantot, nemainiet oriģinālus tieši, bet gan kopijas
    (lai nezaudētu neapmeklēto vietu sarakstu)
  lituanien: Pilni du YAML failai su visais regionais ir departamentais yra pateikiami
    kartu su aplikacija. Naudojant, nemodifikuokite originalų, o kopijas (kad neprarastumėte
    neaplankytų vietovių sąrašo)
  malais: Dua fail YAML lengkap, dengan semua kawasan dan jabatan, dibekalkan dengan
    aplikasi. Jika digunakan, jangan ubah suai fail asal secara langsung tetapi salinan
    sahaja (untuk mengelakkan kehilangan senarai tempat yang belum dilawati)
  malgache: Ireo rakitra YAML roa feno, miaraka amin'ny faritra sy departemanta rehetra,
    dia omena miaraka amin'ny fampiharana. Raha ampiasaina, aza ovaina mivantana ny
    tany am-boalohany fa makà dika (mba tsy ho very ny lisitry ny toerana tsy notsidihina)
  maltais: Iż-żewġ fajls YAMLs kompluti, bir-reġjuni u d-dipartimenti kollha, huma
    pprovduti mal-applikazzjoni. Fil-każ ta' użu, timmodifikax direttament l-oriġinali
    iżda kopji (biex ma tintilifx il-lista tal-postijiet mhux miżjura)
  mandarin standard: 完整的两个 YAML 文件，包含所有地区和部门，随应用程序一起提供。使用时，不要直接修改原件，而是修改副本（以免丢失未访问地点列表）。
  mongol: Хоёр бүрэн YAML файл нь бүх бүс нутаг, департаментуудыг багтаасан ба аппликейшнтэй
    хамт нийлүүлсэн. Хэрэв ашиглах бол, эх хувилбаруудыг шууд өөрчлөхгүй, харин хуулбарыг
    ашиглаарай (аваагүй газрын жагсаалтыг алдахгүйн тулд)
  norvégien: De to komplette YAML-filene, med alle regioner og departementer, leveres
    med applikasjonen. Ved bruk, ikke endre originalene direkte, men heller kopier
    (for ikke å miste listen over ikke-besøkte steder)
  néerlandais: De twee volledige YAML-bestanden, met alle regio's en departementen,
    worden bij de applicatie geleverd. Bij gebruik, wijzig de originelen niet direct
    maar kopieën (om de lijst met niet-bezochte plaatsen niet te verliezen)
  népalais: दुवै पूर्ण YAML फाइलहरू, सम्पूर्ण क्षेत्र र विभागहरू सहित, अनुप्रयोगसँगै
    प्रदान गरिएका छन्। प्रयोग गर्दा, मूल फाइलहरूलाई सिधै परिमार्जन नगर्नुहोस्, बरु
    प्रतिलिपिहरू प्रयोग गर्नुहोस् (नभेटिएका ठाउँहरूको सूची गुमाउनु हुँदैन)।
  ourdou: مکمل YAML فائلیں، جن میں تمام علاقے اور محکمے شامل ہیں، ایپلیکیشن کے ساتھ
    فراہم کیے گئے ہیں۔ استعمال کی صورت میں، اصل فائلوں میں براہ راست ترمیم نہ کریں
    بلکہ ان کی کاپیاں استعمال کریں (تاکہ غیر دورہ شدہ مقامات کی فہرست ضائع نہ ہو)۔
  ouzbek: Ilova bilan butun hududlar va departamentlar bilan to'liq YAML fayllari
    taqdim etilgan. Agar foydalaniladigan bo'lsa, asl nusxalarni to'g'ridan-to'g'ri
    o'zgartirmang, balki nusxalarini o'zgartiring (tashrif buyurilmagan joylar ro'yxatini
    yo'qotmaslik uchun)
  pachto: دواړه بشپړ YAML فایلونه، د ټولو سیمو او څانګو سره، د اپلیکېشن سره وړاندې
    شوي دي. د کارولو په صورت کې، اصلي فایلونه په مستقیم ډول مه بدلوئ بلکې کاپي یې
    وکاروئ (ترڅو د نه لیدل شوو ځایونو لیست له لاسه ورنکړئ)
  persan: دو فایل کامل YAML، همراه با تمام مناطق و شهرستان‌ها، همراه با برنامه ارائه
    شده است. در صورت استفاده، فایل‌های اصلی را مستقیماً تغییر ندهید، بلکه از کپی‌ها
    استفاده کنید (تا فهرست مکان‌های بازدید نشده از دست نرود)
  polonais: Dwa kompletne pliki YAML, zawierające wszystkie regiony i departamenty,
    są dostarczane wraz z aplikacją. W przypadku użycia, nie należy bezpośrednio modyfikować
    oryginałów, lecz raczej kopie (aby nie stracić listy nieodwiedzonych miejsc)
  portugais: Os dois arquivos YAML completos, com todas as regiões e departamentos,
    são fornecidos com o aplicativo. Em caso de utilização, não modificar diretamente
    os originais, mas sim cópias (a fim de não perder a lista de lugares não visitados)
  roumain: Cele două fișiere YAML complete, cu toate regiunile și departamentele,
    sunt furnizate odată cu aplicația. În cazul utilizării, nu modificați direct originalele,
    ci mai degrabă copii (pentru a nu pierde lista locurilor nevizitate)
  russe: Два полных YAML файла, содержащих все регионы и департаменты, поставляются
    вместе с приложением. В случае использования, не изменяйте оригиналы напрямую,
    а используйте копии (чтобы не потерять список не посещенных мест)
  serbo-croate: Dva kompletna YAML fajla, sa svim regionima i departmanima, isporučuju
    se s aplikacijom. U slučaju korištenja, nemojte direktno mijenjati originale,
    već kopije (kako ne biste izgubili listu neposjećenih mjesta)
  slovaque: Kompletné YAML súbory, s celými regiónmi a okresmi, sú dodávané s aplikáciou.
    V prípade použitia nemeniť priamo originály, ale skôr kópie (aby sa nestratil
    zoznam nenavštívených miest)
  slovène: Dve celoviti datoteki YAML, z vsemi regijami in departmaji, sta priloženi
    aplikaciji. V primeru uporabe ne spreminjajte izvirnikov neposredno, ampak raje
    kopije (da ne bi izgubili seznama neobiskanih krajev)
  suédois: De två fullständiga YAML-filerna, med alla regioner och departement, medföljer
    applikationen. Vid användning, modifiera inte originalen direkt utan kopior (för
    att inte förlora listan över obevakade platser)
  swahili: Faili zote mbili za YAML zilizokamilika, zikiwa na mikoa yote na idara,
    zinatolewa na programu. Ikitumika, usibadilishe moja kwa moja zile asili bali
    nakala (ili usipoteze orodha ya maeneo ambayo hayajatembelewa)
  tamoul: முழுமையான YAML கோப்புகள் இரண்டும், அனைத்துப் பகுதிகளையும் மற்றும் மாவட்டங்களையும்
    உள்ளடக்கியவை, பயன்பாட்டுடன் வழங்கப்படுகின்றன. பயன்படுத்தும் போது, ​​அசல் கோப்புகளை
    நேரடியாகத் திருத்தாமல், நகல்களைப் பயன்படுத்தவும் (பார்க்கப்படாத இடங்களின் பட்டியலை
    இழக்காமல் இருக்க)
  tchèque: Kompletní soubory YAML, se všemi regiony a departementy, jsou dodávány
    s aplikací. V případě použití neměňte přímo originály, ale raději kopie (aby nedošlo
    ke ztrátě seznamu nenavštívených míst)
  thaï: ไฟล์ YAML สองไฟล์ที่สมบูรณ์ พร้อมทั้งภูมิภาคและจังหวัดทั้งหมด ถูกจัดเตรียมไว้ให้พร้อมกับแอปพลิเคชัน
    ในกรณีที่ใช้งาน ห้ามแก้ไขไฟล์ต้นฉบับโดยตรง แต่ให้แก้ไขสำเนาแทน (เพื่อไม่ให้สูญเสียรายชื่อสถานที่ที่ยังไม่ได้ไป)
  tibétain: YAML ཡིག་ཆ་གཉིས་ཀ་ས་ཁུལ་དང་སྡེ་ཚན་ཚང་མ་དང་བཅས་པ་འདི་མཉེན་ཆས་དང་མཉམ་དུ་སྤྲད་ཡོད།
    བེད་སྤྱོད་བྱེད་དུས་ཐད་ཀར་མ་བཅོས་པར་འདྲ་བཤུས་བཟོ་དགོས། (མ་བསྐྱོད་པའི་ས་གནས་ཀྱི་ཐོ་གཞུང་བོར་བརླག་མི་འགྱུར་བའི་ཆེད་དུ།)
  turc: Uygulama ile birlikte, tüm bölgeleri ve illeri içeren iki adet eksiksiz YAML
    dosyası sağlanmaktadır. Kullanım durumunda, orijinal dosyaları doğrudan değiştirmeyin,
    bunun yerine kopyalarını kullanın (ziyaret edilmeyen yerlerin listesini kaybetmemek
    için)
  turkmène: Iki doly YAML faýllary, ähli sebitler we departamentler bilen, programma
    bilen bilelikde berilýär. Ulanmak ýagdaýynda, asyl nusgalary göni üýtgetmäň, eýsem
    nusgalaryny (görülmedik ýerleriň sanawyny ýitirmezlik üçin) ulanmak has gowudyr
  ukrainien: Обидва повних файли YAML, з усіма регіонами та департаментами, постачаються
    з додатком. У разі використання, не змінюйте безпосередньо оригінали, а скоріше
    копії (щоб не втратити список невідвіданих місць)
  vietnamien: Hai tệp YAML hoàn chỉnh, với đầy đủ các vùng và tỉnh, được cung cấp
    cùng với ứng dụng. Trong trường hợp sử dụng, không trực tiếp sửa đổi bản gốc mà
    nên sao chép (để không làm mất danh sách các địa điểm chưa đến)
  zoulou: Amafayela amabili agcwalisiwe e-YAML, anazo zonke izifunda neminyango, anikezelwa
    ngohlelo lokusebenza. Uma esetshenziswa, ungalungisi ngokuqondile amafayela okuqala,
    kodwa sebenzisa amakhophi (ukuze ungalahlekelwa uhlu lwezindawo ezingahambiwe)
